import React, { useEffect, useState } from 'react';
import { fetchDailyData } from '../../api'

const Charts = () => {
    const [ dailyData, setDayliData ] = useState({});

    useEffect(() => {
        const fetchAPI = async () => {
            setDayliData(await fetchDaylyData());
        }
        fetchAPI();
    })

    return(
        <h1>Charts</h1>
    );
}
export default Charts;
